import React from 'react';
import './Hero.css';

const Hero = () => {
  return (
    <div className="hero-section">
      <div className="hero-content">
        <h1>Leading Chemical Engineering Solutions</h1>
        <h2>Innovative Process Design & Environmental Analysis</h2>
        <p>Transform your industrial processes with our expert consulting services</p>
        <button className="cta-button">Schedule a Consultation</button>
      </div>
    </div>
  );
};

export default Hero;
